        var sortedList = list[0].sort();
        apiResults = list[0].sort().map(item => <ListItem key={item.id} movie={item} request={request}/>)
        console.log(apiResults);
    }

    const content = apiResults?.length ? apiResults: <h1>No matching movies</h1>
    return (
        <main>{content}</main>
    )

}
export default List
